CREATE FUNCTION "ob-poc".log_cbu_status_change() RETURNS trigger
    LANGUAGE plpgsql
    AS $$
BEGIN
    IF OLD.status IS DISTINCT FROM NEW.status THEN
        INSERT INTO "ob-poc".cbu_change_log (
            cbu_id, change_type, field_name, old_value, new_value, changed_at
        ) VALUES (
            NEW.cbu_id, 
            'STATUS_CHANGE', 
            'status',
            to_jsonb(OLD.status),
            to_jsonb(NEW.status),
            now()
        );
    END IF;
    RETURN NEW;
END;
$$;


